CREATE TABLE City (
  ID INTEGER PRIMARY KEY NOT NULL,
  Name TEXT NOT NULL DEFAULT '',
  CountryCode TEXT NOT NULL DEFAULT '',
  District TEXT NOT NULL DEFAULT '',
  Population INTEGER NOT NULL DEFAULT 0
);

CREATE TABLE Country (
  Code TEXT NOT NULL,
  Name TEXT NOT NULL,
  Continent TEXT NOT NULL,
  Region TEXT NOT NULL,
  SurfaceArea REAL NOT NULL,
  IndepYear INTEGER,
  Population INTEGER NOT NULL,
  LifeExpectancy REAL,
  GNP REAL,
  GNPOld REAL,
  LocalName TEXT NOT NULL,
  GovernmentForm TEXT NOT NULL,
  HeadOfState TEXT,
  Capital INTEGER,
  Code2 TEXT NOT NULL,
  PRIMARY KEY (Code)
);

CREATE TABLE CountryLanguage (
  CountryCode TEXT NOT NULL,
  Language TEXT NOT NULL,
  IsOfficial INTEGER NOT NULL DEFAULT 0,
  Percentage REAL NOT NULL,
  PRIMARY KEY (CountryCode,Language)
);

CREATE TRIGGER Delete_Country DELETE ON Country
  BEGIN
    DELETE FROM City WHERE CountryCode = old.Code;
    DELETE FROM CountryLanguage WHERE CountryCode = old.Code;
  END;

CREATE VIEW Country Capitals AS
  SELECT Country.Name AS Country, City.Name AS Capital City 
  FROM Country, City 
  WHERE Country.Capital = City.ID
  ORDER BY Country, Capital City;

CREATE TRIGGER Update_Country_Capitals INSTEAD OF UPDATE OF Country ON Country Capitals 
  BEGIN
    UPDATE Country SET Name = New.Country WHERE Name = Old.Country;
  END;

CREATE VIEW Country Languages AS
  SELECT Country.Name AS Country, CountryLanguage.Language AS Language 
  FROM Country, CountryLanguage 
  WHERE Country.Code = CountryLanguage.CountryCode
  ORDER BY Country, Language;

CREATE VIEW Country Official Languages AS
  SELECT Country.Name AS Country, CountryLanguage.Language AS Language 
  FROM Country, CountryLanguage 
  WHERE Country.Code = CountryLanguage.CountryCode AND
        CountryLanguage.IsOfficial
  ORDER BY Country, Language;

